        <script type="text/javascript">
        jQuery(document).ready(function($) {
            //Inicio Procesar Cola
            //
            //
            

            $('#colas option').hide();
            $('#colas option[data-name="default"]').show();

            $('#wtd').on('change', function(event) {
                event.preventDefault();

                $('#colas option[data-name="default"]').prop('selected', true);
                if ($('#wtd').val() == '') {
                    $('#colas option').hide();
                    $('#colas option[data-name="default"]').show();
                }

                if ($('#wtd').val() == 'add-url') {
                    $('#colas option').hide();
                    $('#colas option[data-type="add-url"]').show();
                    $('#colas option[data-source="manual"]').hide();
                }

                if ($('#wtd').val() == 'cola-publicar') {
                    $('#colas option').hide();
                    $('#colas option[data-type="cola-publicar"]').show();
                }
                
            });

            jQuery('#start').on('click', function(event) {
                event.preventDefault();
                var colaid = $('#colas').val();
                interval = setInterval(function() {

                    $.post('<?php bloginfo('url');?>/?runcola=' + colaid + '&token' + Math.random(), {},
                        function(data, textStatus, xhr) {
                            if (data == 'done') {
                                clearInterval(interval);
                                swal(
                                      'Listo!',
                                      'Cola procesada exitosamente!',
                                      'success'
                                    );
                               // alert('Listo, cola procesada!!');
                            } else {
                                $('.table-log').append(data);

                                if ($( "#colas option:selected" ).attr('data-source') == 'url' ) {
                                    clearInterval(interval);
                                    swal(
                                      'Listo!',
                                      'Cola procesada exitosamente!',
                                      'success'
                                    );}
                            }
                        });

                }, 2000);
            });
            //Fin Procesar Cola
        });
        </script>
